import './App.css';
import React from "react";
import {Routes,Route} from "react-router-dom";
import Home from "./routes/Home";
import About from "./routes/About";

function App() {
  return (
    <Routes> 
      <Route path="/" element={Home} />
      <Route path="/about" element={About} />
    </Routes>
  )
}

export default App;
